import React from 'react';
import { Card, CardContent, Typography, Box, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const ResultsComponent = ({ results }) => {
  if (!results) return null;

  const { attributes } = results;
  const { date, results: scanResults } = attributes;

  return (
    <Box sx={{ mt: 4 }}>
      <Card>
        <CardContent>
          <Typography variant="h5" component="h2">
            Analysis Results
          </Typography>
          <Typography variant="subtitle1" component="div" sx={{ mt: 2 }}>
            Date: {new Date(date * 1000).toLocaleString()}
          </Typography>
          <TableContainer component={Paper} sx={{ mt: 2 }}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Engine Name</TableCell>
                  <TableCell>Category</TableCell>
                  <TableCell>Method</TableCell>
                  <TableCell>Result</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {Object.keys(scanResults).map((key) => (
                  <TableRow key={key}>
                    <TableCell>{scanResults[key].engine_name}</TableCell>
                    <TableCell>{scanResults[key].category}</TableCell>
                    <TableCell>{scanResults[key].method}</TableCell>
                    <TableCell>{scanResults[key].result}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </CardContent>
      </Card>
    </Box>
  );
};

export default ResultsComponent;
